BasicGame.Preloader = function (game) {
};

BasicGame.Preloader.prototype = {
	init: function () {
	},

	preload: function () {
		tempList = new Array(2);
		tempColor = new Array(2);
		
		this.load.image('background1',background1);
		this.load.image('background2',background2);
		this.load.image('background3',background3);
		
		this.load.image('button',buttonPNG);
		this.load.image('logo',logoPNG);
		this.load.image('nflpa',nflpaPNG);
		this.load.image('bar',barPNG);
		this.load.image('arrow',arrowPNG);
		this.load.image('frame',framePNG);
		
		this.load.spritesheet('football',footballPNG,319.5,130.25,12);
		
		//Preloader Sprites based on selected teams
		////TEST SPRITES
		this.load.atlasJSONHash('playerHeadshots',playerTextures,null,playerJSON);
	},

	create: function () {
		console.log(settings.screen1);
		if(settings.screen1){
			this.state.start('Screen1');
		}else if(settings.screen2){
			if(settings.timer){
				this.state.start('Screen2',true,false, settings.max_play_time * 1000);
			}else{
				this.state.start('Screen2',true,false, 0);
			}
		}else{
			temp = this.rnd.integerInRange(1,2);
			if(temp == 1){
				tempList[0] = players[awayP1].lastName + '_' + players[awayP1].firstName + '.png';
				tempColor[0] = parseInt("0x" + teams[homeTeam].colors[1]);
			}else{
				tempList[0] = players[homeP1].lastName + '_' + players[homeP1].firstName + '.png';
				tempColor[0] = parseInt("0x" + teams[awayTeam].colors[1]);
			}
			if(!playerJSON["frames"].hasOwnProperty(tempList[0])){
				if(homeP1 != 'mRyan' && awayP1 != 'mRyan'){
					tempList[0] = 'Ryan_Matt.png';
				}else if(homeP1 != 'eManning' && awayP1 != 'eManning'){
					tempList[0]  = 'Manning_Eli.png';
				}else{
					tempList[0]  = 'Rodgers_Aaron.png';
				}
			}
			temp = this.rnd.integerInRange(1,2);
			if(temp == 1){
				tempList[1] = players[awayP2].lastName + '_' + players[awayP2].firstName + '.png';
				tempColor[1] = parseInt("0x" + teams[homeTeam].colors[1]);
			}else{
				tempList[1] = players[homeP2].lastName + '_' + players[homeP2].firstName + '.png';
				tempColor[1] = parseInt("0x" + teams[awayTeam].colors[1]);
			}
			if(!playerJSON["frames"].hasOwnProperty(tempList[1])){
				if(homeP2 != 'dJohnson' && awayP2 != 'dJohnson'){
					tempList[1] = 'Johnson_David.png';
				}else if(homeP2 != 'dFreeman' && awayP2 != 'dFreeman'){
					tempList[1]  = 'Freeman_Devonta.png';
				}else{
					tempList[1]  = 'Howard_Jordan.png';
				}
			}
			if(settings.timer){
				this.state.start('Screen3',true,false, settings.max_play_time*1000, tempList, tempColor);
			}else{
				this.state.start('Screen3',true,false, 0, tempList, tempColor);
			}
		}
		
		
	},
	
	loadUpdate: function () {
	}
};